import React from "react";
import { useHistory } from "react-router-dom";
import HomeImg from "../assets/homescreen.png";
const Home = () => {
  const history = useHistory();
  return (
    <div className="max-w-full max-h-screen text-center">
      <nav className="h-20">
        <ul className="flex float-right mt-5 text-sm">
          <li
            className="px-3 py-1.5 mx-4 text-base cursor-pointer transform hover:scale-125"
            onClick={() => history.push("/login")}
          >
            Log In
          </li>
          <li
            className="px-3 py-1.5 mx-4 text-base text-white bg-black cursor-pointer hover:bg-purple-300 transition-all"
            onClick={() => history.push("/registration")}
          >
            Sign Up
          </li>
        </ul>
      </nav>
      <main>
        <div className="mt-7 g-56 grid grid-cols-2">
          <div className="font-mono flex flex-col self-center py-3">
            <h1 className="flex flex-col text-5xl font-bold">
              <span>La Vie</span>
              <span className="text-lg">When your heart speaks, take good notes</span>
            </h1>
          </div>
          <div>
            <img
              src={HomeImg}
              alt="home"
              className="hidden w-10/12   object-fit lg:block"
            />
          </div>
        </div>
      </main>
    </div>
  );
};

export default Home;
